		function filterDegrees() {
			// init Isotope
			var $defaultFilters = $('.filter-button-group').find(".button:first-child");
			var $buttons = $('.filter-area .button');
			// store filter for each group
			var filters = {};
			var $degreesGrid = $('.program-grid').isotope({
				itemSelector: '.program-grid .program-card',
				layoutMode: 'fitRows'
			});
			// change is-checked class on buttons + toggle 'checked' property to any checkbox inputs within clicked button
			setCheckedFilters();

			function setCheckedFilters() {
				$('.button-group').each(function(i, buttonGroup) {
					var $buttonGroup = $(buttonGroup);
					$buttonGroup.unbind().on('click', 'button', function() {
						$buttonGroup.find('.is-checked').removeClass('is-checked').find('input').prop("checked", false);
						$(this).addClass('is-checked').find('input').prop("checked", true);
					});
				});
			}
			// clicking reset button resets filters
			$('.filter-area .reset-button').unbind().on("click", function(e) {
				e.stopPropagation();
				e.preventDefault();
				resetFilters();
			});

			function resetFilters() {
				// reset filters
				$degreesGrid.isotope({
					filter: '*'
				});
				// reset buttons
				$buttons.removeClass('is-checked').find('input[type=checkbox]').prop("checked", false);
				$defaultFilters.addClass('is-checked').find('input[type=checkbox]').prop("checked", true);
			}
			// flatten object by concatting values
			function concatValues(obj) {
				var value = '';
				for (var prop in obj) {
					value += obj[prop];
				}
				return value;
			}
			$('.filter-area').unbind().on('click', '.button', function() {
				var $this = $(this);
				// get group key
				var $buttonGroup = $this.parents('.button-group');
				var filterGroup = $buttonGroup.attr('data-filter-group');
				// set filter for group
				filters[filterGroup] = $this.attr('data-filter');
				// combine filters
				var filterValue = concatValues(filters);
				// set filter for Isotope
				$degreesGrid.isotope({
					filter: filterValue, //stagger: 30,
				});

				function noResults() {
					if ($('.program-grid').height() == 0) {
						// console.log('no results found');
						$('.no-results').addClass('no-results--show');
					} else {
						// console.log('results found');
						$('.no-results').removeClass('no-results--show');
					}
				}
				setTimeout(noResults, 300);
			});
		}

